import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

import './OrderPlacedTab.scss';

export class OrderPlacedTab extends Component {
    render() {
        const { restaurantLink } = this.props;
        return (
            <div className={'order-placed-container'}>
                <h2>Your order was successfully placed!</h2>
                <p>
                    Lorem, ipsum dolor sit amet consectetur adipisicing elit.
                    Aut corrupti labore voluptate ipsam asperiores! Quam hic
                    voluptatum ipsum saepe omnis, illo rerum odit. Alias, nihil
                    ea quo sequi repellat ratione!
                </p>
                <h5>Bon Appetit!</h5>
                <Link to={restaurantLink || ''} className={'app-invisible-link'}>
                    <Button variant={'contained'} color={'primary'} >
                        Back to menu
                    </Button>
                </Link>
            </div>
        );
    }
}
OrderPlacedTab.PropTypes = {
    restaurantLink: PropTypes.string
};
